import React from 'react';
import './Time.css';
import moment from 'moment';

// Return Title
export default function ReturnSuBTime() {

 let pushDate = new Array();
 var now = moment();
 let dateNumber = now.date();
 const range = [...Array(dateNumber).keys()];

 [...range].map((index) => {

  let getAddDate = now.subtract(1, 'day').local('fr').format('L');
  pushDate.unshift(getAddDate);
 });

 return (
  <div className='wrp-time-sub'>
   {range.map(index => {
    return <h1>{pushDate[index + 1]}</h1>
   })}
   <h1 style={{ lineHeight: '0.07' }}>{moment().local('fr').format('L')}</h1>
  </div>
 );
};
